//keyframes
nav {
  position: fixed;
  bottom: 15px;
  left: 15px;
  height: 50px;
  width: 50px;
  border-radius: 50%;
  overflow: hidden;
  transition: height 0.5s, width 0.5s, left 0.5s, bottom 0.5s, border-radius 0.3s;
  z-index:1;

}

nav.is-open {
  height: 100vh;
  width: 100vw;
  border-radius: 0;
  left: 0;
  bottom: 0;
  background-color:$fourthcolor;
  opacity:0.5;
